(168, 'elementor_remote_info_feed_data', 'a:5:{i:0;a:5:{s:5:\"title\";s:64:\"Monday Masterclass: How to Design Navigation Menus for WordPress\";s:7:\"excerpt\";s:276:\"This week we’re looking at how at navigation menus and what makes them so critical to user experience and SEO ranking. We also review the 5 primary styles of menu design on WordPress websites, and examine the important do’s & don’ts to consider when designing nav-menus.\";s:7:\"created\";s:10:\"1579522814\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:107:\"https://elementor.com/blog/?p=35653&utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:1;a:5:{s:5:\"title\";s:49:\"The Future of Building Websites With Adam Preiser\";s:7:\"excerpt\";s:148:\"WordPress influencer and entrepreneur Adam Preiser (WPCrafter) will join us for a special webinar with our head of content Ben Pines. Don\'t miss it!\";s:7:\"created\";s:10:\"1579162028\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:120:\"https://elementor.com/blog/webinar-adam-preiser/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:2;a:5:{s:5:\"title\";s:51:\"Monthly Template Kits #6: The Magazine Template Kit\";s:7:\"excerpt\";s:124:\"This month’s template kit will enable you to create amazing looking blogs and magazines. Meet the Magazine Template Kit. \";s:7:\"created\";s:10:\"1579071877\";s:5:\"badge\";s:7:\"Freebie\";s:3:\"url\";s:121:\"https://elementor.com/blog/magazine-template-kit/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:3;a:5:{s:5:\"title\";s:46:\"Elementor Sites of the Month – December 2019\";s:7:\"excerpt\";s:76:\"Here are our top picks of Elementor sites for December 2019. Check them out!\";s:7:\"created\";s:10:\"1578908299\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:122:\"https://elementor.com/blog/showcase-december-2019/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:4;a:5:{s:5:\"title\";s:60:\"Elementor Talks #56: Breaking the Rules of Content 